import React, { useState } from "react";
import { Form, Input, Button, Card, Typography } from "antd";
import { Link, useNavigate } from "react-router-dom";
import Logo1 from "../../assets/images/logo1.png";
import "./auth.css";

const { Title } = Typography;

const Register = () => {
  const navigate = useNavigate();

  const [userName, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [registered, setRegistered] = useState(false);

  const handleRegister = async () => {
    try {
      setRegistered(true);

      navigate("/login");
      const response = await fetch("http://localhost:3001/api/auth/registration", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({ userName, email, password }),
        credentials: 'include'
      });
      if (!response.ok) {
        throw new Error("Network response was not ok");
      }
    } catch (error) {
      console.error("Registration failed:", error);
    }
  };

  const validatePassword = (_, value) => {
    if (!value) {
      return Promise.reject(new Error("Խնդրում ենք մուտքագրել գաղտնաբառը!"));
    }
    if (value.length < 8 || !/[A-Z]/.test(value) || !/\d/.test(value)) {
      return Promise.reject(
        new Error(
          "Գաղտնաբառը պետք է լինի առնվազն 8 նիշ երկարությամբ, պարունակի առնվազն մեկ մեծատառ և մեկ թիվ"
        )
      );
    }
    return Promise.resolve();
  };

  return (
    <div className="auth-container">
      <Card className="auth-card">
        <div className="card-content">
          <div className="form-container">
            <Title level={2}>Registration</Title>
            <Form onFinish={handleRegister} layout="vertical">
              <Form.Item
                label="full name"
                name="username"
                rules={[
                  {
                    required: true,
                    message: "please enter your full name",
                  },
                ]}
                required>
                <Input
                  placeholder="full name"
                  className="input"
                  value={userName}
                  onChange={(e) => setUsername(e.target.value)}
                />
              </Form.Item>
              <Form.Item
                label="email"
                name="email"
                rules={[
                  {
                    required: true,
                    message: "please enter your email",
                  },
                ]}
                required>
                <Input
                  type="email"
                  placeholder="Էլ․ Փոստ"
                  className="input"
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                />
              </Form.Item>
              <Form.Item
                label="Գաղտնաբառ"
                name="password"
                rules={[{ validator: validatePassword }]}
                required>
                <Input.Password
                  placeholder="Գաղտնաբառ"
                  className="input"
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                />
              </Form.Item>
              <Form.Item>
                {registered ? (
                  <Link to={"/login"}>
                    <div>dfghjk</div>
                  </Link>
                ) : (
                  <Button type="primary" htmlType="submit" block>
                    Գրանցվել
                  </Button>
                )}
              </Form.Item>
            </Form>
            <div style={{ marginTop: "16px" }}>
              Արդեն ունեք հաշիվ? <Link to="/login">Մուտք</Link>
            </div>
          </div>
          <div className="logo-containerr">
            <Link to="/">
              <img src={Logo1} alt="Logo" className="auth-logo" />
            </Link>
          </div>
        </div>
      </Card>
    </div>
  );
};

export default Register;
